INSERT INTO `player` VALUES (1,1998,'1976-03-24','Peyton Manning','Manning signed a 5 year, $96 million contract with the Broncos on March 20, 2012. Upon signing Manning had $18 million of the contract fully guaranteed. His 2013 and 2014 base salaries became fully guaranteed following his passing of a 2013 physical exam.<br />\r\n<br />\r\nIn 2013 the Broncos advanced Manning $10 million in salary which is prorated over the course of the contract. The Broncos have an injury waiver on future guarantees if Manning re-injures his neck.<br />\r\n<br />\r\nOn March 4, 2015 Manning agreed to reduce his 2015 base salary from $19 million to $15 million. If we find out any additional details we will further update Manning\'s cap charges. Manning can earn incentives of $2 million for an AFC Championship win and $2 million for a Super Bowl win.','Tennessee',1,1,1998,'6-5',10,230),(2,2011,'1989-03-26','Von Miller','The Broncos and Von Miller agreed to a six year, $114.5 million contract on July 15, 2016. Per Mike Klis, <a href=\"http://www.9news.com/sports/nfl/denver-broncos/mike-klis/von-miller-is-a-bronco-reaches-agreement-on-six-year-contract/274328718\">Miller received $70 million in guarantees, $42 million of which is guaranteed upon signing</a>. The full guarantee is made up of a $17.5 million signing bonus, $6 million roster bonus, and his Paragraph 5 salaries in 2016 and 2017. In March of 2017 Miller\'s $19 million salary in 2018 will become fully guaranteed. If Miller is on the roster in March of 2018, $9 million of his 2019 base salary will become fully guranteed. The final two years of the contract are option seasons. Denver has until the final day of the prior League year to pick up each option season. If the options are exercised Miller will have $6 million and $7 million of his 2020 and 2021 salaries become guaranteed.','Texas A&M',2,1,2011,'6-3',13,250),(3,2008,'1986-09-06','Ryan Clady','Clady was traded to the Jets on April 11, 2016. The new contract has a base value of $6 million in 2016 but we do not yet know how much of that total is paid as a bonus or is incentivized. The cap charge here is likely the worst case scenario and will be updated when the full details are released.','Boise State',12,1,2008,'6-6',13,315),(4,1999,'1978-06-22','Champ Bailey','CB Champ Bailey signed a two year, $3.75 million contract with the New Orleans Saints on April 9, 2014. Bailey received a $500,000 signing bonus. If Bailey is on the active gameday roster for six games in 2014 he will earn an additional $250,000 roster bonus. In 2015 Bailey will earn a $250,000 roster bonus on the 5<sup>th</sup> day of the League Year and another $250,000 if on the roster on week 1. Base salaries of the contract are $1,000,000(2014) and $1,500,000(2015).<br />\r\n<br />\r\nBailey was released by the Broncos on March 5, 2014. He had one year remaining on his contract. His release saved Denver $10 million in cap room.','Georgia',7,1,1999,'6-0',20,192),(5,2012,'1990-07-05','Aaron Brewer','Aaron Brewer signed  one year, $760,000 contract with the Bears on March 17, 2016.','San Diego State',0,0,2012,'6-5',13,230),(6,2008,'1985-04-15','Andre Caldwell','','Florida',97,3,2008,'6-0',7,200),(7,1999,'1976-06-23','Brandon Stokley','','Louisiana-Lafayette',105,4,1999,'6-0',5,194),(8,2012,'1990-11-22','Brock Osweiler','Brock Osweiler signed a four year contract with the Houston Texans worth $72 million on March 9, 2016. Osweiler received $37 million in fully guranteed salary including a $12 million signing bonus.','Arizona State',57,2,2012,'6-8',13,240),(9,2011,'1989-06-18','Chris Harris, Jr.','CB Chris Harris signed a $42.5 million contract extension with the Denver Broncos on December 12, 2014. Harris received a $10 million signing bonus. We will update the rest of his salaries once we have more details on the contract.','Kansas',0,0,2011,'5-10',13,199),(10,2006,'1982-12-19','Chris Kuper','','North Dakota',161,5,2006,'6-4',13,303),(11,2011,'1900-01-01','CJ Davis','',NULL,0,0,0,NULL,0,NULL),(12,2004,'1979-09-12','Dan Koppen','','Boston College',164,5,2003,'6-3',2,296),(13,2012,'1990-03-24','Danny Trevathan','Danny Trevathan signed a four year, $28 million contract with the Chicago Bears on March 9, 2016. Trevathan received $13.5  million guaranteed upon signing including a $5 million signing bonus.','Kentucky',188,6,2012,'6-1',13,240),(14,2010,'1987-03-15','Eric Decker','WR Eric Decker signed a five year, $36.25 million contract with the New York Jets on March 13, 2014. Decker received $15 million fully guaranteed. The guarantee is made up of Decker\'s 2014 and 2015 base salaries and a $7.5 million signing bonus. Base salaries of the contract are $2,500,000(2014), $5,000,000(2015), $6,500,000(2016), $7,250,000(2017), and $7,500,000(2018).','Minnesota',87,3,2010,'6-3',13,214),(15,2012,'1990-02-24','Derek Wolfe','Derek Wolfe signed a four year, $36.7 million contract with the Broncos on January 16, 2016. The contract contains $12 million fully guaranteed and $17.5 million in total guarantees.  According to Mike Klis of 9News, <a href=\"http://www.9news.com/story/sports/nfl/denver-broncos/mike-klis/2016/01/15/derek-wolfe-denver-broncos/78869394/\" target=\"_blank\">Wolfe received a $7.5 million signing bonus</a> and his base salary in 2017 will become fully guarnteed on the 7th day of the league year. Klis also reported that there are yearly per game active bonuses for Wolfe that total $500,000. At this time we are estimating Wolfe\'s 2018 and 2019 base salaries.','Cincinnati',36,2,2012,'6-5',13,285),(16,2009,'1986-02-15','Paul Kruger','LB Paul Kruger signed a five year, $40.5 million contract with the Cleveland Browns on March 12, 2013. Kruger received $13 million in fully guarantees, which was comprised of a $6 million signing bonus, $6.285 million roster bonus and a $715,000 2013 base salary. Kruger earned an additional $7 million base salary guarantee in 2015 when he was on the roster after the 2013 Super Bowl. Base salaries are $715,000(2013), $7,000,000(2014), $7,000,000(2015), $6,500,000(2016), and $7,000,000(2017).','Utah',57,2,2009,'6-4',5,270),(17,2010,'1987-12-25','Demaryius Thomas','Demaryius Thomas signed a five year, $70 million contract with the Denver Broncos on July 15, 2015. The contract contains $35 million in fully guaranteed salary and $43.5 million of total guarantees. According to Mike Klis, <a href=\"http://www.9news.com/story/sports/2015/07/15/broncos-demaryius-thomas/30205697/\" target=\"_blank\">Thomas received an $11 million signing bonus</a> and will earn a guaranteed roster bonus worth $6.5 million. His $13 million salary in 2016 is fully guarateed and an $8.5 million salary is injury guaranteed and will vest to fully guaranteed in 2017. There is a $4 million option due in 2017 that will  buy back the 2018 and 2019 league year. If the option is not exercised the final two years of the contract will void.','Georgia Tech',22,1,2010,'6-3',13,229),(18,2007,'1984-05-07','Drew Stanton','Drew Stanton signed a two yer, $6.5 million contract with the Arizona Cardinals on March 9, 2016. Stanton received $4.5 million in guarantees including a $2 million signing bonus. Stanton can earn up to $8.7 million in incentives.','Michigan State',43,2,2007,'6-3',22,243),(19,2014,'1989-10-13','Gerell Robinson','Robinson signed a one year $420,000 contract with the Broncos on February 5, 2014. ','Arizona State',0,0,2012,'6-4',13,220),(20,2010,'1987-03-24','J.D. Walton','J.D. Walton signed a one year $1.025 million contract with the Miami Dolphins. Walton received a $250,000 signing bonus.','Baylor',80,3,2010,'6-3',13,305),(21,2008,'1900-01-01','Jacob Hester','',NULL,0,0,0,NULL,0,NULL),(22,2008,'1985-03-15','Jacob Tamme','','Kentucky',127,4,2008,'6-3',10,230),(23,2012,'1900-01-01','Jeremy Beal','',NULL,0,0,0,NULL,0,NULL),(24,2008,'1985-07-06','Joe Mays','','North Dakota State',200,6,2008,'5-11',19,244),(25,2006,'1982-07-26','Joel Dreessen ','The Broncos signed Dreessen to a three year $8.