s can earn incentives based on playing time, interceptions, and pro bowl selections.','Delaware',0,0,2004,'5-10',31,195),(34,2011,'1988-07-12','Nate Irving','','North Carolina State',67,3,2011,'6-1',13,245),(35,2012,'1988-12-20','Omar Bolden','','Arizona State',101,4,2012,'5-10',13,195),(36,2011,'1987-12-16','Orlando Franklin','Orlando Franklin signed a five year, $36.5 million contract with the Chargers on March 10, 2015. The contact contains $16.5 million in fully guaranteed salary. The guarantee is made up of a $8 million signing bonus and his 2015 and 2016 base salaries. If Franklin is on the roster on the 3rd day of the 2017 League Year his 2017 salary will become fully guaranteed.','Miami',46,2,2011,'6-7',13,320),(37,2014,'1985-11-27','Philip Blake','','Baylor',108,4,2012,'6-3',13,310),(38,2001,'1979-06-19','Quentin Jammer','','Texas',5,1,2002,'6-0',15,204),(39,2011,'1988-07-20','Quinton Carter','','Oklahoma',108,4,2011,'6-1',13,200),(40,2011,'1990-02-11','Rahim Moore','Rahim Moore signed a three year, $12 million contract with the Texans on March 12, 2015. Moore received a $4 million in full guarantees including a $3 million signing bonus and his 2015 base salary','UCLA',45,2,2011,'6-1',13,195),(41,2009,'1985-09-06','Robert Ayers','Robert Ayers signed a three year $19.5 million contract with the Buccanneers. Ayers received $11.5 million in guarantees, $7.5 million of which is guaranteed upon signing. The balance becomes fully guaranteed on the 5th day of the 2017 league year. Another $1.65 million is available in performance incentives.','Tennessee',18,1,2009,'6-3',13,274),(42,2012,'1991-09-14','Ronnie Hillman','Ronnie Hillman signed a one year, $2 million contract with the Broncos on April 19, 2016. Hillman received $500,000 in guarantees including a $100, signing bonus.','San Diego State',67,3,2012,'5-10',13,195),(43,2013,'1990-04-26','Sealver Siliga','Sealver Siliga signed a $1.05 million contract with the Seahawks. Siliga received a $200,000 signing bonus.','Utah',0,0,2011,'6-2',31,325),(44,2012,'1988-03-28','Steven Johnson','','Kansas',0,0,2012,'6-1',13,237),(45,2011,'1986-04-27','Trindon Holliday','','LSU',197,6,2010,'5-5',9,170),(46,2011,'1988-08-03','Virgil Green','','Nevada',204,7,2011,'6-5',13,255),(47,2008,'1986-07-21','Wesley Woodyard','LB Wesley Woodyard signed a four year, $15.75 million contract with the Tennessee Titans on March 14, 2014. Woodyard received a $3 million signing bonus and his 2014 base salary is fully guaranteed. If he is on the roster on the 5th day of the 2017 League Year he will receive a $500,000 roster bonus. Base salaries are $1,750,000(2014), $2,750,000(2015), $3,500,000(2016), and $4,250,000(2017).','Kentucky',0,0,2008,'6-0',13,233),(48,2003,'1981-10-21','Willis McGahee','','Miami',23,1,2003,'6-0',1,235),(49,2010,'1986-11-19','Zane Beadles','G Zane Beadles signed a three year, $9.75 million contract with the 49ers on March 22, 2016. Beadles received $3.3 million in guarantees of which $2.8 million is fully guaranteed. Beadles received a $1.75 million signing bonus. He can earn up to $500,000 per year in incentives.','Utah',45,2,2010,'6-4',13,305),(50,2012,'1989-09-30','A.J. Jenkins','','Illinois',30,1,2012,'6-0',31,200),(51,2006,'1984-03-14','Ahmad Brooks','LB Ahmad Brooks restructured his contract with the San Francisco 49ers on July 26, 2014.  Brooks reduced his salary by $3.395 million and converted that money into a prorated signing bonus. Per our information Brooks has an incentive added to his contract in 2014 which will count $450,000 against the salary cap and also has a reporting bonus of $450,000 in 2015. The restructuring saved the 49ers slightly over $2 million in salary cap space.','Virginia',-1,3,2006,'6-3',7,259),(52,2011,'1989-09-25','Aldon Smith','Aldon Smith signed a two year, $11.5 million contract with the Oakland Raiders on April 6, 2016. Smith received no guarantees with the contract. In each year of the contract he can earn up to $4 million in per game active roster bonuses and there are $500,000 in annual workout bonuses. There are $3.5 million in yearly incentives that can also be earned based on performance and honors as well as a 2017 escalator worth $1.5 million.','Missouri',7,1,2011,'6-4',31,265),(53,2010,'1987-05-04','Alex Boone','G Alex Boone renegotiated his contract with the San Francisco 49ers on September 2, 2014. The total contract value is $6 million over two years with another $2 million available in incentives. The incentives are tied to being selected to the Pro Bowl and named first team All-NFL. Boone\'s new contract called for a $400,000 raise in 2014 and a $1.95 million raise in 2015. In addition the team can not use the Franchise tag on Boone when his contract expires in 2016.','Ohio State',0,0,2009,'6-8',31,300),(54,2004,'1982-08-11','Andy Lee','','Pittsburgh',188,6,2004,'6-2',31,180),(55,2010,'1987-09-24','Anthony Dixon','','Mississippi State',173,6,2010,'6-1',31,233),(56,2000,'1900-01-01','Brian Jennings','',NULL,0,0,0,NULL,0,NULL),(57,2011,'1987-08-06','Bruce Miller','RB Bruce Miller signed a three year contract extension with the San Francisco 49ers on March 21, 2014. The value of the extension is $5.4 million with $2.431 million fully guaranteed. The full guarantee is made up of Miller\'s 2014 base salary and a $1.786 million signing bonus. $819,000 of Miller\'s 2015 salary is currently guaranteed for injury only and will become fully guaranteed if on the roster on April 1, 2015. Each extension years carries up to $160,000 in per game active roster bonuses and $200,000 incentives for being selected to the Pro Bowl. Base salaries are $635,000(2014), $1,100,000(2015), $1,250,000(2016), and $1,450,000(2017).','Central Florida',211,7,2011,'6-2',31,248),(58,2009,'1986-05-06','C.J. Spillman','','Marshall',0,0,2009,'6-0',15,199),(59,2013,'1990-05-24','Cam Johnson','','Virginia',237,7,2012,'6-3',31,268),(60,2005,'1981-07-02','Carlos Rogers','CB Carlos Rogers signed a one year $2.5 million contract with the Oakland Raiders on April 1, 2014. Rogers received a $1 million signing bonus. He can earn up to $250,000 in per game active roster bonuses. The total value of the contract can reach $3.5 million based on meeting playtime incentives.','Auburn',9,1,2005,'6-0',20,192),(61,2011,'1988-08-17','Chris Culliver','Chris Culliver signed a one year, $3.575 million contract with the Dolphins. The contract has $300,000 guaranteed.','South Carolina',80,3,2011,'6-0',31,199),(62,2011,'1987-11-03','Colin Kaepernick','Colin Kaepernick signed a six year, $114 million extension with the San Francisco 49ers on June 4, 2014. Kaepernick received $12,973,766 in full guarantees made up of a $645,000 base salary and $12,328,766 signing bonus. From 2015 through 2017 his entire base salary is guaranteed for injury only as is $5.2 million of his 2018 base salary. If Kaepernick is on the 49ers roster on April 1 of the respective League Year the guarantee vests to full. Kaepernick can earn $2 million per year in per game roster bonuses. $12 million in escalators are available. In order to earn the full escalator amount Kaepernick must participate in 80% of the offensive snaps in 2014 and either be named first or second team All Pro or be on the active roster of a Super Bowl team. For each year that this is not accomplished the escalator value reduces by $2 million.<br />\r\n.','Nevada',36,2,2011,'6-4',31,230),(63,2011,'1987-12-18','Daniel Kilgore','Daniel Kilgore signed a three year, $5.25 million extension with the 49ers on February 27, 2014. Kilgore received a $1.35 million signing bonus and a fully guaranteed base salary in 2014. In every year he can earn up to $200,000 in per game active roster bonuses and he also has a $600,000 roster bonus due in April of 2015. Kilgore can earn escalators of $900,000 in 2016 and 2017. Base salaries of the contract are $645,000(2014), $800,000(2015), $900,000(2016), and $1,000,000(2017)','Appalachian State',163,5,2011,'6-3',31,308),(64,2012,'1989-07-19','Darius Fleming','','Notre Dame',165,5,2012,'6-2',31,255),(65,2009,'1987-04-07','Jared Cook','Jared Cook signed a one year, $2.75 million contract with the Packers on March 28, 2016. Cook received an $825,000 signing bonus which is the guaranteed portion of the contract. Cook will earn a $75,000 option bonus if he remains on the roster in June. $400,000 is tied to per game active roster bonuses. Cook can earn an additional $900,000 in incentives based on performance and honors.','South Carolina',89,3,2009,'6-5',12,254),(66,2010,'1987-11-03','Cassius Vaughn','CB Cassius Vaughn signed a one year $730,000 contract with the Detroit Lions on April 7, 2014. Vaughn qualifies for the minimum salary benefit.','Mississippi',0,0,2010,'5-11',13,195),(67,2009,'1986-11-08','Sammie Lee Hill','','Stillman',115,4,2009,'6-4',22,328),(68,2011,'1987-11-30','Demarcus Dobbs','','Georgia',0,0,2011,'6-6',31,282),(69,2006,'1985-07-24','Donte Whitner','Donte Whitner signed a four year, $28 million contract with the Cleveland Browns on March 11, 2014. Whitner received a $9 million signing bonus and a fully guaranteed 2014 base salary. He will earn another $2 million in guarantees if on the roster 5 days following the 2014 Super Bowel. Base salaries of the contract are $2,000,000(2014), $4,500,000(2015), $6,200,000(2016), and $6,300,000(2017).','Ohio State',8,1,2006,'5-10',1,208),(70,2012,'1988-05-29','Garrett Celek','Garrett Celek signed a 4 year contract worth $10.2 million with the 49ers on February 19, 2016.  Celek received a $2.5 million signing bonus and also has a $1 million salary guarantee in 2016. Celeks 2017 base salary is guaranteed for injury and will become fully guaranteed on April 1 of 2017. In each year of the contract he can earn up to $350,000 in per game roster bonuses.','Michigan State',0,0,2012,'6-5',31,252),(71,2011,'1989-08-31','Ian Williams','Ian Williams signed a 1 year, $3 million contract with the 49ers on March 23, 2015. $2 million of the contract is ties to games