act totals $21,977,427, with $8,977,427 being fully guaranteed. The remaining guarantees are for injury only but will vest during the waiver period of the specific seasons to full guarantees.','Utah State',47,2,2012,'6-0',32,241),(1532,2010,'1984-08-02','Brandon Browner','CB Brandon Browner signed a $760,000 contract with the Seahawks on April 18, 2016. Because Browner has a larger guaranteed salary from the Saints this season I do not believe that Browner will qualify for the minimum salary benefit despite published reports to the contrary.','Oregon State',0,0,2005,'6-4',13,221),(1533,2008,'1985-09-27','Breno Giacomini','Breno Giacomini signed a 4 year contract worth $18 million with the New York Jets on March 13, 2014. Giacomini received $7 million in fully guaranteed salary made up of a $2.5 million signing bonus, $1 million roster bonus, $1 million base salary in 2014, and $2.5 million of his 2015 base salary.','Louisville',150,5,2008,'6-7',23,318),(1534,2012,'1987-11-01','Bruce Irvin','Bruce Irvin signed a four year, $37 million contract with the Oakland Raiders on March 9, 2018. Irvin received $14.5 million fully guaranteed upon signing. The guarantee consists of his 2016 salary and roster bonus as well as his 2017 roster bonus. Irvins $4.5 million 2017 salary becomes fully guaranteed if he is on the roster on the 3rd day of the 2017 league year. Another $2 million is available as Pro Bowl incentives.','West Virginia',15,1,2012,'6-3',32,248),(1535,2011,'1988-02-23','Byron Maxwell','Byron Maxwell signed a 6 year, $63 million contract with the Eagles on March 12, 2015. Maxwell received $25 million fully guaranteed upon signing, including a $6 million signing bonus and $6.5 million roster bonus.','Clemson',173,6,2011,'6-1',32,207),(1536,2009,'1900-01-01','Charly Martin','',NULL,0,0,0,NULL,0,NULL),(1537,2004,'1981-10-30','Chris Clemons','Clemons signed a three year, $22 million contract with the Seahawks on July 27, 2012. Clemons received a $6.5 million signing bonus and his $2 million base salary in 2012 and $1.5 million of his 2013 base salary was fully guaranteed.','Georgia',0,0,2003,'6-3',20,254),(1538,2014,'1989-06-28','Deshawn Shead','','Portland State',0,0,2012,'6-2',32,220),(1539,2011,'1988-09-21','Doug Baldwin','WR Doug Baldwin signed a four year, $46 million contract extension with the Seahawks on June 29, 2016. Baldwin received $12 million in full guarantees upon signing and $24.25 million in total guarantees. If he is on the roster on the 5th day of the 2017 waiver period his entire 2017 P5 will become fully guaranteed. Another $4.5 million will become fully guaranteed if on the roster on the 5th day of the 2018 waiver period. There are annual per game roster bonuses starting in 2017.','Stanford',0,0,2011,'5-10',32,189),(1540,2010,'1989-05-07','Earl Thomas','S Earl Thomas signed a four year contract extension worth $40 million with the Seattle Seahawks on April 29, 2014. Thomas received a signing bonus of $9.5 million. His 2014 salary remained the same as in his rookie contract and is fully guaranteed. In 2015 his $5.5 million base salary will become guaranteed on the 5th day of the waiver period. Thomas has a $6 million guarantee on his 2016 base salary which will become fully guaranteed on the 5th day of the waiver period in 2016. Base salaries of the contract are $4,725,000(2014), $5,500,000(2015), $8,000,000(2016), $8,500,000(2017), and $8,500,000(2018).','Texas',14,1,2010,'5-10',32,202),(1541,2010,'1988-08-02','Golden Tate','WR Golden Tate signed a five year, $31 million contract with the Detroit Lions on March 13, 2014. Tate received an $8 million signing bonus with the contract and has his entire 2014 and $1 million of his 2015 base salary fully guaranteed. If Tate is on the roster on the 3rd day of the 2015 league year his 2015 salary will become fully guaranteed. Base salaries of the contract are $1,500,000(2014), $3,750,000(2015), $4,750,000(2016), $6,000,000(2017), and $7,000,000(2018). Tate converted 