,4,2012,'6-3',32,301),(1547,2012,'1990-07-14','Jeremy Lane','Jeremy Lane signed a four year, $23 million contract with the Seattle Seahawks on March 10, 2016. Lane received a $5 million signing bonus and a 2016 base salary guarantee to bring the full guarantee to $7 million. If Lane is on the Seahawks roster following the 2016 Super Bowl he will receive another $4 million in full guarantees.','Northwestern State-Louisiana',172,6,2012,'6-0',32,190),(1548,2012,'1990-02-06','Jermaine Kearse','Jermaine Kearse signed a 3 year, $13.5 million contract with the Seahawks on March 9, 2016. Kearse receieved a $6.3 million guarantee including a $5.5 million signing bonus. Kearse can earn up to $1.4 million per year in incentives.','Washington',0,0,2012,'6-1',32,209),(1549,2011,'1988-06-12','Jeron Johnson','S Jeron Johnson signed a one year contract with the Seattle Seahawks worth $1,500,000 on April 10, 2014. Johnson received a $250,000 signing bonus and can earn up to $250,000 in gameday active roster bonuses. Another $500,000 in incentives are also available.','Boise State',0,0,2011,'5-10',32,212),(1550,2011,'1986-10-28','John Moffitt','The Philadelphia Eagles signed John Moffitt to a one year contract worth $660,000 on June 28, 2015.','Wisconsin',75,3,2011,'6-4',32,319),(1551,2006,'1981-11-26','Jon Ryan','Jon Ryan signed a four year, $10 million contract with the Seattle Seahawks on March 12, 2016. Ryan received a $2.4 million signing bonus.','Regina (Canada)',0,0,2006,'6-0',23,217),(1552,2011,'1989-07-23','KJ Wright','','Mississippi State',99,4,2011,'6-4',32,246),(1553,2011,'1987-05-19','Lemuel Jeanpierre','Lemuel Jeanpierre signed a one year, $825,000 contract with the Seattle Seahawks on April 20, 2015. Jeanpierre received an $80,000 signing bonus. His contract qualifies for the minimum salary benefit.','South Carolina',0,0,2010,'6-3',14,301),(1554,2009,'1988-05-28','Percy Harvin','Percy Harvin signed a 1 year, $6 million contract with the Bills on March 19, 2015. Harvin 