ith the Cleveland Browns on March 27, 2014. McQuistan received a $750,000 signing bonus.','Weber State',69,3,2006,'6-6',16,315),(1564,2008,'1984-04-18','Red Bryant','The Buffao Bills signed Red Bryant to a one year contract worth $950,000 on August 18, 2015. Bryant received an $80,000 signing bonus and can earn up to $100,000 in incentives.','Texas A&M',121,4,2008,'6-4',32,323),(1565,2011,'1988-03-30','Richard Sherman','CB Richard Sherman signed a four year, $56 million contract extension with the Seattle Seahawks on May 7, 2014. The contract contains $40 million in guarantees of which $12.431 million is fully guaranteed. The fully guaranteed portion of the contract is made up of his 2014 base salary and an $11 million signing bonus. If Sherman is on the roster five days following the 2015 Super Bowl his $10 million 2015 base salary will become fully guaranteed. If he is on the roster five days after the 2016 Super Bowl his $12.569 million 2016 base salary and $5 million of his 2017 base salary will become fully guaranteed. Sherman\'s years salaries are $1,431,000(2014), $10,000,000(2015), $12,569,000(2016), $11,431,000(2017), and $11,000,000(2018).','Stanford',154,5,2011,'6-3',32,195),(1566,2012,'1989-02-23','Rishaw Johnson','','California (PA)',0,0,2012,'6-3',32,313),(1567,2012,'1989-12-02','Robert Turbin','','Utah State',106,4,2012,'5-10',32,222),(1568,2010,'1988-10-07','Russell Okung','Russell Okung signed a five year contract worth $53 million with the Denver Broncos on March 17, 2016. In the first year of the contract Okung will earn a $1 million workout bonus and a $2 million roster bonus if he is on the active roster for at least one game in the season. $3 million is available in incentives in 2016. The Broncos have until the final day of the league year to pick up an option for the next four years, which are  valued at $48 million. If the Broncos fail to exercise the option, which costs $1 million, Okung will be a free agent in 2017. If picked up Okung will recieve $19.5 million in fully guaranteed salary including an $8 million roster bonus in 2017 and his 2017 and 2018 base salaries. In each option year of the contract Okung has $1.5 million ties to per game active roster bonuses.<br />\r\n<br />\r\n<a href=\"http://overthecap.com/thoughts-russell-okungs-contract-broncos/\" target=\"_blank\">You can read my thoughts on Okungs contract here </a>','Oklahoma State',6,1,2010,'6-5',32,310),(1569,2012,'1988-11-29','Russell Wilson','Russell Wilson signed a four year contract extension with the Seahawks worth $87.6 million on July 31, 2015. According to SI\'s Peter King, Wilson received a $31 million signing bonus. Per Ian Rapoport of NFL.com <a href=\"https://twitter.com/RapSheet/status/627170316763049985\">the following tweet has the breakdown of the Wilson extension</a> which we are using to estimate the cap charges at the moment. Wilson received $31.7 million fully guaranteed upon signing. His 2016, 2017, and $4.9 million of his 2018 salary are guaranteed for injury and will become fully guaranteed on the 5th day of the waiver period in each year. The total guarantee is $61.542 million.','Wisconsin',75,3,2012,'5-11',32,206),(1570,2015,'1987-12-03','Sean McGrath','','Henderson State',0,0,2012,'6-5',32,247),(1571,2007,'1986-09-01','Sidney Rice','WR Sidney Rice signed a one year, $1.4 million contract with the Seattle Seahawks on April 18, 2014. Rice received a $150,000 signing bonus. Rice can earn up to $250,000 in per game active roster bonuses.','South Carolina',44,2,2007,'6-3',24,202),(1572,2011,'1986-06-29','Stephen Williams','','Toledo',0,0,2010,'6-5',29,208),(1573,2010,'1987-08-12','Walter Thurmond','','Oregon',111,4,2010,'5-11',32,190),(1574,2012,'1990-04-23','Winston Guy','','Kentucky',181,6,2012,'6-1',32,218),(1575,2007,'1984-10-04','Zach Miller','Zach Miller signed a two year, $5.5 million contract with the Bears on March 14, 2016. Miller received $3 million in guarantees including a $1 million signing bonus.','