tsburgh-steelers/stories/201503160130\" target=\"_blank\">Details of the contract are based primarily on a report by Ed Bouchette of the Pittsburgh Post-Gazette</a>. According to Bouchette, Roethlisberger received a $31 million signing bonus. The first three years of the contract are guaranteed for injury which is where the reported $65 million in guarantees comes from. $9 million in escalators are available in the final two contract years. The new contract saved the Steelers about $1.15 million in 2015 cap space.','Miami (Ohio)',11,1,2004,'6-5',8,241),(1581,2013,'1900-01-01','Isakko Aaitui','',NULL,0,0,0,NULL,0,NULL),(1582,2002,'1978-09-19','Brett Keisel','DE Brett Keisel signed a two year, $3 million contract with the Pittsburgh Steelers on August 20, 2014. Keisel received a $500,000 signing bonus.','BYU',242,7,2002,'6-5',8,285),(1583,2012,'1900-01-01','Brian Rolle','',NULL,0,0,0,NULL,0,NULL),(1584,0,'1900-01-01','Byron Leftwich','',NULL,0,0,0,NULL,0,NULL),(1585,2011,'1989-05-06','Cameron Heyward','Cameron Heyward signed a five year contract extension with the Pittsburgh Steelers on July 21, 2015. The extension has a new money value of $52.281 million and total value of $59.25 million. Heyward received $15 million in full guarantees which includes a $12 million signing bonus and $3 million roster bonus paid in 2015. In 2016, Heyward will receive a $5 million roster bonus if on the roster on the 3rd day of the League Year. In 2017, Heyward will earn a $3 million roster bonus on the 3rd day of the League Year.','Ohio State',31,1,2011,'6-5',8,288),(1586,0,'1900-01-01','Charlie Batch','',NULL,0,0,0,NULL,0,NULL),(1587,2011,'1989-04-06','Chris Carter','','Fresno State',162,5,2011,'6-1',8,248),(1588,2011,'1988-10-29','Cortez Allen','CB Cortez Allen signed a four year contract extension worth $24.6 million with the Pittsburgh Steelers on September 6, 2014. Allen received a $6.75M signing bonus and will receive a $3 million roster bonus on the 5th day of the 2015 League Ye